import img1 from "../img/img1.png";
import img2 from "../img/img2.png";
import img3 from "../img/img3.png";
import img4 from "../img/img4.png";

export const Followers = [
  { name: "Neymar Jr.", username: "Neymarjr", img: img1 },
  { name: "Virat Kohli", username: "KingKohli", img: img2 },
  { name: "Lionel Messi", username: "BossMessi", img: img3 },
  { name: "Elon Musk", username: "Tesla", img: img4 },
];
